"إن كُلِّ مجد وكُلَّ كرامة وكُلَّ سجود كُلِّ حين، يليق بالثَالُوثْ القُدُّوسْ، الآب والابن والْرُوحْ القُدُسْ، الآنْ وكُلَّ أوانْ وإلى دَهْرِ الدُهُورْ كلها آمْينْ. حِلْ واغفر واصفح لنا يا اللّه عن زلاتنا، التي صنعناها بإرادتنا والتي صنعناها بِغَيْر إرادتنا، التي فعلناها بمعرفة والتي فعلناها بِغَيْر مَعَرفة، الخفية والظاهرة، يا رَبّ اغفرها لنا من أجل اسمك القُدُّوسْ الذي دعي علينا. كرحمتك يا رَبّ ولَيس كخطايانا. يا رئيس الحياة وملك الدهور، كلمة اللّه الآب، رَبّنا وإلَهْنَا ومُخَلِصّْنَا يَسُوعْ المسيح، الخبز الحقيقي الذي نزل من السَّمَاء، واهب الحياة، لمن يتناوله، اجعلنا أهلاً، بِغَيْر وقوع في الدينونة، أنْ نتناول من جسدك المُقَدَّسْ ودمك الكريم. وليصيرنا تناولنا من أسرارك المُقَدَّسْة، واحداً مَعَك إلى الانقضاء، وباركنا. أنْتَ هو ابنُ اللّه. لَكَ المَجْدُ مَعَه ومَعَ الْرُوحْ القُدُسْ المحيي، إلى الآبد آمْينْ. إجعلنا مُسْتَحِقِّينْ كلنا يا سَيِّدنْا أنْ نتناول من جسدك المُقَدَّسْ، ودمك الكريم، طهارة لأنفسنا وأجسادنا وأرواحنا، ومغفرة لخطايانا وآثُمَّنا، لكي نكون جسداً واحداً وروحاً واحداً مَعَك. المَجْدُ لك، مَعَ أبِيكَ الصَالِحْ والْرُوحْ القُدُسْ إلى الأبَدْ آمْينْ. يا رَبّنا يَسُوعْ المسيح، اجعلنا مُسْتَحِقِّينْ أنْ نتناول من جسدك الطاهر، ودمك الكريم، ولا يكون لنا دينونة. لَكِنْ كما قُلْت لتلاميذك الأطهار، خذوا من جسدي ودمي لِمَغْفِرَةْ خطاياكم، يكون لنا شركة مَعَ تلاميذك الأطهار، لننال بتناولنا لأسرارك المحيية لِمَغْفِرَةْ خَطَايَانَا وصفحاً لآثامنا، وطهراً لأنفسنا وثباتاً على الإيمان بِاسْمِكَ القُدُّوسْ، بطلبات الطاهرة مرت مريم وكافة قديسيك. آمْينْ.", 
