"2) Ô Toi qui as rendu l'âme dans les mains du Père quand Tu as été crucifié à la neuvième heure et qui as conduit au paradis le brigand crucifié avec Toi, ne me néglige pas, ô Dieu bon, ne me rejette pas moi l'errant, mais sanctifie mon âme, éclaire mon esprit et fais-moi partager la grâce de Tes mystères vivifiants afin qu'après avoir goûté à Ta bonté, je puisse T'offrir des louanges sans aucune tiédeur ; j'éprouve le désir de voir Ta gloire mieux que toute autre chose ; ô Christ notre Dieu, délivre-nous.", 
