"4) Quand le brigand vit le chef de la vie (le Créateur) crucifié, il dit : « Si Celui qui est crucifié avec nous n'était pas Dieu incarné, le soleil ne se serait pas caché et la terre n'aurait pas tremblé, mais, ô Dieu Tout-Puissant, Toi qui as tout enduré, souviens-Toi de moi ô Seigneur quand Tu viendras dans Ton Royaume. »", 
